import React from 'react'
import {
  BroswerRouter as Router,
  Link
} from 'react-router-dom'
import { Card, Icon } from 'semantic-ui-react'



const Main = (props) => {
  return (
    <div className="Main">
      <br></br>
      <br></br>
      <br></br>
      <br></br>


      {/* <h1>All Songs</h1> */}



      <Card.Group>
            {
              props.songs.map(recent => (
                <Card key={recent.id}>
                <Card.Content header={recent.name} />
                <Card.Content description={recent.artist} />
                <Card.Content extra>
                <Link to={recent.url}><Icon name="play" />Play Song</Link>
                </Card.Content>
                </Card>
              ))
            }
      </Card.Group>
    </div>
  )
}


export default Main
